import React from "react";
import heart_card from '../assets/images/heart_card.svg';
import eye from '../assets/images/eye.svg';
import Wrapper from "../assets/wrappers/Card";
import background from "../assets/images/play_game.png";

const Card = () => {
  return (
      <Wrapper>
        <div className="card_box" style={{backgroundImage: `url(${background})`}}>
      <div>
        <span>-40%</span>
        <img src={heart_card} />
      </div>
      <img src={eye} />
        </div>
  </Wrapper>
)
};

export default Card;
